import React from "react";
import HeaderLogo from "../assets/logo.png";

function Logo() {
  return (
    <a href="/">
      <img src={HeaderLogo} alt="Logo" width={80} height={80} />
      <h1>Perfect Balance</h1>
    </a>
  );
}

export default Logo;
